import { lazy } from "react";
import Sidebar from "./Sidebar";

const Header = lazy(() => import("./Header"));

const Layout = () => {
    return (
        <div className="w-full min-h-screen h-full flex flex-col">
            <Header />

            <div>
                <Sidebar />
            </div>
        </div>
    )
}

export default Layout;
